INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24401,	14597,	0,	'Y as, el cuento de Rapunzel nos ensea sobre el amor, la lealtad y el poder de la bondad que triunfa sobre el mal.',	'07CA5493-5D04-4DB4-BE4A-F4D5C59EA7DA'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24397,	14596,	0,	'Desesperado, el prncipe salt de la torre, y las espinas lo dejaron ciego.',	'CF7B2246-688C-4B7E-837D-6201968426E0'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24398,	14596,	1,	'Vag por el desierto buscando a Rapunzel.',	'C696AEFB-5319-41E0-ACCF-EDE5ABD34704'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24399,	14596,	2,	'Finalmente, la encontr, y sus lgrimas de alegra curaron sus ojos.',	'E0650A31-F8A5-47D1-9546-0BBF35FE0A9C'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24400,	14596,	3,	'Vivieron felices para siempre.',	'E9D681B7-5E5F-4ED6-B535-06CB113FF26F'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24393,	14595,	0,	'Desafortunadamente, la hechicera descubri su plan.',	'75A300E4-3237-4A24-B25E-DA2A6DE1071F'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24394,	14595,	1,	'Enojada, cort el cabello de Rapunzel y la desterr al desierto.',	'68111FA6-7AFF-4EB2-8BC3-68FE46BB2C77'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24395,	14595,	2,	'Cuando el prncipe vino a visitarla, la hechicera baj el cabello cortado de Rapunzel, y l subi.',	'E733F67D-A87C-45DE-BDB8-1061348DDDBD'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24396,	14595,	3,	'Para su sorpresa, encontr a la hechicera en lugar de Rapunzel.',	'57BB8BE3-147E-4640-985E-72730310506E'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24390,	14594,	0,	'El prncipe aprendi las palabras mgicas y visit a Rapunzel en secreto.',	'ACEF318F-F6A2-469E-89F8-6FACA6B0C3BF'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24391,	14594,	1,	'Se enamoraron, y l prometi rescatarla.',	'10C5AC72-8E62-44BA-800D-666BE173257A'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24392,	14594,	2,	'Rapunzel acept escapar con l cuando regresara.',	'11013695-13BA-4F9C-8F64-22AD3C9AF436'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24387,	14593,	0,	'Rapunzel tena cabello largo y hermoso, y la hechicera lo usaba como una escalera.',	'C463A8B9-1189-442B-97FA-6A22E7DBD3BE'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24388,	14593,	1,	'Un da, un prncipe escuch a Rapunzel cantar en la torre y qued cautivado por su voz.',	'FAC0ACDE-49F9-4212-9CDB-7A4AF37A344F'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24389,	14593,	2,	'Observ cmo la hechicera usaba el cabello de Rapunzel para subir y decidi intentarlo l mismo.',	'C1AFBF98-DB1A-47BC-9620-FF8F19271A60'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24384,	14592,	0,	'La pareja tuvo una nia, y la hechicera vino a reclamarla.',	'323E3947-0B82-461B-9059-3DA907F04992'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24385,	14592,	1,	'Le puso el nombre de Rapunzel y la encerr en una torre sin puertas.',	'D0BC8038-6BC9-4EF8-8A44-5AFD867A1362'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24386,	14592,	2,	'La nica entrada era una ventana en la parte superior, y la hechicera la visitaba llamndola: "Rapunzel, Rapunzel, baja tu cabello".',	'69083163-3EFE-4517-9327-EC2EEEAB9A6B'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24381,	14591,	0,	'El esposo, queriendo complacer a su esposa, se col en el jardn para conseguir la rapunzel.',	'7836845B-B27A-4E37-AE90-3D0AA94E697C'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24382,	14591,	1,	'Sin embargo, fue descubierto por la hechicera.',	'F0AF9FAD-962B-48F3-B995-CFA7189DAFB1'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24383,	14591,	2,	'Ella accedi a dejarlo llevar tanta rapunzel como su esposa quisiera, pero a cambio, deba prometer darle el hijo una vez que naciera.',	'A14FFD89-646B-4B81-A554-9C0126E782D6'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24379,	14590,	0,	'Haba una vez una pareja que quera un hijo.',	'5D01010C-1E14-406F-AEE9-8572D2F96B51'			);
INSERT INTO [Idioma].Sentence(Id,ParagraphId,Ordinal,Text,UniqueKey)values(	24380,	14590,	1,	'La esposa, que estaba esperando, tena antojo de una planta llamada rapunzel, que creca en un jardn cercano perteneciente a una hechicera.',	'061B43EB-219A-4FCF-BD29-C67BA427E73F'			);
